description:
WordPerfect 10 is a powerful word-processing application that helps you produce newsletters, articles, reports, proposals, books, and other documents. WordPerfect lets you add graphics, tables, and charts to documents. You can publish to paper, electronic media, and the World Wide Web. WordPerfect allows you to format, structure, and edit documents at any time and gives you complete control over their design.
